import './Css/main.css';
import Navbar from './components/HomePage/Navbar';


function ContactPage(){
  const handleSubmit = (event) => {
    event.preventDefault();
  return (
    <div className="App">
      <Navbar />
      <div className='content'>
      <div className="contact-container">
      <div className="contact-info">
        <h2>İLETİŞİM BİLGİLERİ</h2>
        <p>KAFT Tasarım Tekstil San. ve Tic. A.Ş.</p>
        <p>Mersis No: 0487052510200026</p>
        <p>KEP: kaft@hs01.kep.tr</p>
        <p>KAFT ile ilgili herhangi bir konuda bilgi almak, istek, öneri veya şikayetler için aşağıdaki e-posta adresimizi de kullanabilirsin: info@kaft.com</p>
        <p>Siparişleriniz ve kargolarınız hakkında bilgi almak için aşağıdaki e-posta adresimizi de kullanabilirsin: order@kaft.com</p>
        <h3>TELEFONLARIMIZ</h3>
        <p>Müşteri Hizmetleri: +90 212 2673634 (9:00–18:00 / Pazartesi-Cuma)</p>
        <p>Ofis: +90 212 8432349</p>
        <p>Faks: +90 212 2673638</p>
        <h3>ADRESLERİMİZ</h3>
        <p>Ofis: Konaklar Mah. Akasyalı Sk. No:12 34330 Beşiktaş/İstanbul Türkiye</p>
        <p>Depo: Yakuplu Mah. Bakırcılar ve Pirinççiler San. Sit. Karanfil Cad. No:5 Kat:1 İstanbul, Türkiye</p>
      </div>

      <div className="contact-form">
        <h1>İletişim</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">Adınız:</label>
            <input type="text" id="name" name="name" required />
          </div>

          <div className="form-group">
            <label htmlFor="surname">Soyadınız:</label>
            <input type="text" id="surname" name="surname" required />
          </div>

          <div className="form-group">
            <label htmlFor="subject">Konu:</label>
            <input type="text" id="subject" name="subject" required />
          </div>

          <div className="form-group">
            <label htmlFor="message">Mesajınız:</label>
            <textarea id="message" name="message" rows="5" required></textarea>
          </div>

          <button type="submit" className="btn btn-primary">Gönder</button>
        </form>
      </div>
    </div>
      </div>
  
    </div>
  );
}
}
